import {Component} from "react";

export class Item extends Component{
    render() {
        return(
            <>
                <span style={{marginLeft: "10px"}}>{this.props.item.title}</span>
                <span style={{marginRight: "60px"}}>{this.props.item.price}</span>
                <img src="./img/miniBasket.png" className="buyImg" alt="buy"/>
            </>
        )
    }
}
export default Item
